import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    const screenshots = [];
    // Initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for a product card using a unique selector (use .product-title text)
    await page.waitForSelector('.product-title');
    // Find all product titles
    const productTitles = await page.$$eval('.product-title', els => els.map(e => e.textContent.trim()));
    // Pick the first product title for interaction
    const firstProductTitle = productTitles[0];

    // Use text selector to click the product card by its title (to open modal)
    const productCard = await page.locator(`.product-title:text-is("${firstProductTitle}")`).first();
    // Scroll into view and click parent .product-card
    const productCardHandle = await productCard.evaluateHandle(node => node.closest('.product-card'));
    await productCardHandle.asElement().scrollIntoViewIfNeeded();
    await productCardHandle.asElement().click();

    // Wait for the modal to appear (modal has id="productModal" and style.display='block')
    await page.waitForSelector('#productModal', { state: 'visible', timeout: 5000 });
    // Wait for modal content to load (wait for .product-detail-title inside modal)
    await page.waitForSelector('#productModal .product-detail-title', { timeout: 5000 });

    // Screenshot of modal open
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_modal_open.png'));

    // Extract product detail modal data for verification
    const modalData = await page.evaluate(() => {
      const modal = document.querySelector('#productModal');
      if (!modal || modal.style.display === 'none') return null;
      const title = modal.querySelector('.product-detail-title')?.textContent?.trim() || '';
      const price = modal.querySelector('.product-detail-price')?.textContent?.replace(/\s+/g, ' ').trim() || '';
      const seller = modal.querySelector('.seller-info')?.textContent?.replace(/\s+/g, ' ').trim() || '';
      const description = modal.querySelector('.product-detail-description p')?.textContent?.trim() || '';
      return { title, price, seller, description };
    });

    return {
      success: true,
      action: "Opened Product Detail Modal for the first product and verified modal content",
      extractedData: modalData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
